import React from "react";

const Home = () => {
    return(
    <Grid container spacing={1} padding={"75px"}>
        <Grid content="justify-center" item xs={12} background-color="red"><h1 content="justify-center">Welcome</h1></Grid>
    </Grid>
    );
}

export default Home;
